import React, { Component } from "react";
import { directive } from "@babel/types";
class Nav extends Component {
  state = {
    giturl: "https://github.com/akshay05091992/Entity-Description-Generation-UI"
  };
  render() {
    return (
      <React.Fragment>
        <p>
          Info-sign icon as a link:
          <a href="#">
            <span className="glyphicon glyphicon-info-sign"></span>
          </a>
          Info-sign icon on a styled link button:
          <a href="#" class="btn btn-info btn-lg">
            <span className="glyphicon glyphicon-info-sign"></span> Info
          </a>
        </p>
        <button className="glyphicon glyphicon-info-sign">i</button>
        <h1>Welcome!</h1>
        <button>GitHub</button>
      </React.Fragment>
    );
  }
}

export default Nav;
